This sample shows how to call SpreadAliasWithOptionalPropsAsync with required parameters and request content.

var endpoint = new Uri("<https://my-service.azure.com>");
var client = new SpreadClient(endpoint);

var data = new {
    name = "<name>",
    items = new[] {
        1234
    },
};

Response response = await client.SpreadAliasWithOptionalPropsAsync("<id>", 1234, RequestContent.Create(data));
Console.WriteLine(response.Status);

This sample shows how to call SpreadAliasWithOptionalPropsAsync with all parameters and request content.

var endpoint = new Uri("<https://my-service.azure.com>");
var client = new SpreadClient(endpoint);

var data = new {
    name = "<name>",
    color = "<color>",
    age = 1234,
    items = new[] {
        1234
    },
    elements = new[] {
        "<String>"
    },
};

Response response = await client.SpreadAliasWithOptionalPropsAsync("<id>", 1234, RequestContent.Create(data), new RequestContext());
Console.WriteLine(response.Status);

